35372af46d9b4dd89a14fde6045c87fb,Електрична енергія, код 09310000-5 – Електрична енергія за ДК 021:2015 «Єдиний закупівельний словник» (ЗЗСО 106)","Мова тендерної пропозиції – українська. Під час проведення процедур закупівель усі документи, що готуються замовником, викладаються українською мовою, а також за рішенням замовника одночасно всі документи можуть мати автентичний переклад іншою мовою. Визначальним є текст, викладений українською мовою. Стандартні характеристики, вимоги, умовні позначення у вигляді скорочень та термінологія, пов’язана з товарами, роботами чи послугами, що закуповуються, передбачені існуючими міжнародними або національними стандартами, нормами та правилами, викладаються мовою їх загальноприйнятого застосування.",847000.0,09310000-5;;;;;;;;;;;;;;;;;;;;
